import React, { useState } from "react";

export default function MBIGSMobileFriendly() {
  const [score, setScore] = useState(null);

  const handleSubmit = () => {
    let total = 0;
    for (let i = 0; i < 16; i++) {
      const selected = document.querySelector(`input[name='q${i}']:checked`);
      if (selected) {
        total += parseInt(selected.value, 10);
      }
    }
    setScore(total);
  };

  const renderResult = () => {
    if (score === null) return null;
    let message = "";
    if (score >= 60) {
      message = "‚ö†Ô∏è ÎÜíÏùÄ Î≤àÏïÑÏõÉ ÏàòÏ§ÄÏù¥ Í∞êÏßÄÎêòÏóàÏäµÎãàÎã§. Ìú¥ÏãùÍ≥º ÏÉÅÎã¥ÏùÑ Í≥†Î†§Ìï¥Î≥¥ÏÑ∏Ïöî.";
    } else if (score >= 40) {
      message = "‚ö†Ô∏è Ï§ëÍ∞Ñ ÏàòÏ§ÄÏùò Î≤àÏïÑÏõÉ Ïã†Ìò∏Í∞Ä ÏûàÏäµÎãàÎã§. ÏûêÍ∏∞Í¥ÄÎ¶¨Ïóê Ï£ºÏùòÍ∞Ä ÌïÑÏöîÌï©ÎãàÎã§.";
    } else {
      message = "üòä Î≤àÏïÑÏõÉ ÏàòÏ§ÄÏù¥ ÎÇÆÏäµÎãàÎã§. ÌòÑÏû¨ ÏÉÅÌÉúÎ•º Ïûò Ïú†ÏßÄÌïòÏÑ∏Ïöî!";
    }
    return (
      <div style={{ marginTop: "1rem", textAlign: "center", background: "#eef2ff", padding: "1rem", borderRadius: "8px" }}>
        <p style={{ fontWeight: "bold" }}>Ï¥ùÏ†ê: {score}Ï†ê</p>
        <p>{message}</p>
      </div>
    );
  };

  const labels = [
    "Ï†ÑÌòÄÏóÜÎã§",
    "1ÎÖÑÏóê 2-3Ìöå ÎòêÎäî Í∑∏ ÎØ∏Îßå",
    "Ìïú Îã¨Ïóê Ìïú Î≤à ÎòêÎäî Í∑∏ ÎØ∏Îßå",
    "Ìïú Îã¨Ïóê 2-3Ìöå",
    "ÏùºÏ£ºÏùºÏóê 1Ìöå Ï†ïÎèÑ",
    "ÏùºÏ£ºÏùºÏóê 2-3Ìöå",
    "Îß§Ïùº"
  ];

  return (
    <div style={{ padding: "1rem", fontFamily: "sans-serif" }}>
      <h2>üìã ÏÑ§Î¨∏ÏßÄ</h2>
      <p>Îã§Ïùå ÏßàÎ¨∏Ïóê 0ÏóêÏÑú 6 ÏÇ¨Ïù¥Ïùò Ï†êÏàòÎ°ú ÎãµÌï¥Ï£ºÏÑ∏Ïöî.</p>
      <table style={{ width: "100%", fontSize: "0.9rem", borderCollapse: "collapse" }}>
        <thead>
          <tr>
            <th>#</th>
            <th style={{ textAlign: "left" }}>ÏßàÎ¨∏ÏßÄ</th>
            {labels.map((label, i) => (
              <th key={i} style={{ fontSize: "10px", padding: "4px" }}>{i}<br />{label}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {[
            "Îß°ÏùÄ ÏùºÏùÑ ÌïòÎäîÎç∞ ÏûàÏñ¥ÏÑú Ï†ïÏÑúÏ†ÅÏúºÎ°ú ÏßÄÏ≥êÏûàÏùåÏùÑ ÎäêÎÇÄÎã§.",
            "ÏßÅÏû• ÏùºÏùÑ ÎßàÏπòÍ≥† Ìá¥Í∑ºÌï† Îïå ÏôÑÏ†ÑÌûà ÏßÄÏ≥êÏûàÏùåÏùÑ ÎäêÎÇÄÎã§.",
            "ÏïÑÏπ®Ïóê ÏùºÏñ¥ÎÇòÏÑú Ï∂úÍ∑ºÌï† ÏÉùÍ∞ÅÎßå ÌïòÎ©¥ ÌîºÍ≥§Ìï®ÏùÑ ÎäêÎÇÄÎã§.",
            "ÌïòÎ£® Ï¢ÖÏùº ÏùºÌïòÎäî Í≤ÉÏùÄ ÎÇòÎ•º Í∏¥Ïû• ÏãúÌÇ®Îã§.",
            "ÎÇòÎäî ÏßÅÎ¨¥ÏÉÅ Î∞úÏÉùÌïòÎäî Î¨∏Ï†úÎì§ÏùÑ Ìö®Í≥ºÏ†ÅÏúºÎ°ú Ìï¥Í≤∞Ìï† Ïàò ÏûàÎã§.",
            "Îß°ÏùÄ ÏùºÏùÑ ÏàòÌñâÌïòÎäîÎç∞ ÏûàÏñ¥ÏÑú ÏôÑÏ†ÑÌûà ÏßÄÏ≥êÏûàÎã§.",
            "ÌòÑÏû¨ ÏÜåÏÜçÎêú ÏßÅÏû•Ïóê Ìö®Í≥ºÏ†ÅÏù∏ Í∏∞Ïó¨Î•º ÌïòÍ≥† ÏûàÎã§Í≥† ÎäêÎÇÄÎã§.",
            "ÌòÑÏû¨Ïùò ÏóÖÎ¨¥Î•º ÏãúÏûëÌïú Ïù¥ÌõÑÎ°ú ÎÇ¥ ÏùºÏóê ÎåÄÌïú Í¥ÄÏã¨Ïù¥ Ï§ÑÏóàÎã§.",
            "Îß°ÏùÄ ÏùºÏùÑ ÌïòÎäîÎç∞ ÏûàÏñ¥ÏÑú ÏÜåÍ∑πÏ†ÅÏù¥ ÎêòÏóàÎã§.",
            "ÎÇ¥Í∞Ä ÏÉùÍ∞ÅÌï† Îïå, ÎÇòÎäî ÏùºÏùÑ Ïûò ÌïúÎã§.",
            "ÏßÅÎ¨¥ÏÉÅ Î¨¥Ïñ∏Í∞ÄÎ•º ÏÑ±Ï∑®ÌñàÏùÑ Îïå Í∏∞ÏÅ®ÏùÑ ÎäêÎÇÄÎã§.",
            "ÎÇòÎäî ÌòÑÏû¨Ïùò ÏßÅÎ¨¥ÏóêÏÑú Í∞ÄÏπò ÏûàÎäî ÎßéÏùÄ Í≤ÉÏùÑ Ïù¥Î£®Ïñ¥ÏôîÎã§.",
            "ÎÇòÎäî Î∞©Ìï¥Î∞õÏßÄ ÏïäÍ≥† ÎÇ¥ ÏùºÏùÑ ÏàòÌñâÌïòÍ∏∞ ÏõêÌï† ÎøêÏù¥Îã§.",
            "ÎÇ¥ ÏóÖÎ¨¥Í∞Ä Î¨¥Ïñ∏Í∞ÄÏóê Í∏∞Ïó¨ÌïòÎì† ÎßêÎì† ÎÇòÎäî Ï†êÏ†ê Îçî ÎÉâÏÜåÏ†ÅÏù¥ ÎêòÏóàÎã§.",
            "ÎÇ¥ ÏßÅÎ¨¥Ïùò Ï§ëÏöîÏÑ±Ïù¥ ÏùòÏã¨Ïä§ÎüΩÎã§.",
            "ÏßÅÎ¨¥ÏÉÅ, ÎÇòÎäî ÏùºÏùÑ Ìö®Í≥ºÏ†ÅÏúºÎ°ú Ï≤òÎ¶¨ÌïòÍ≥† ÏûàÎã§Îäî ÏûêÏã†Í∞êÏù¥ ÏûàÎã§."
          ].map((q, idx) => (
            <tr key={idx}>
              <td>{idx + 1}</td>
              <td style={{ maxWidth: "18rem", wordBreak: "break-word", textAlign: "left" }}>{q}</td>
              {labels.map((_, i) => (
                <td key={i}><input type="radio" name={`q${idx}`} value={i} style={{ width: "16px", height: "16px" }} /></td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
      <div style={{ textAlign: "center", marginTop: "1rem" }}>
        <button onClick={handleSubmit} style={{ background: "black", color: "white", padding: "0.5rem 1rem", borderRadius: "6px" }}>Í≤∞Í≥º Î≥¥Í∏∞</button>
        {renderResult()}
      </div>
    </div>
  );
}
